import React from 'react';
import Card from 'Card';


const CardList = ({robots}) => {
	return (

		<div>
		{robots.map( (rb, i) => {
							<Card 
							key={i}
							name={rb[i].name}
							email={rb[i].email}
							id={rb[i].id}
							/>
					})}
		</div>
	);

}

export default CardList;
